    const titleRespect = 'Respect';

    return (
        <div className='div-about'>
            <div className='image-about'>
                <img src={ImageAbout} alt='image-about'></img>
            </div>
            <div className='dropdown-container'>
                <DropDown />
            </div>
        </div>
    );
}

